
-- UTF8 WITH BOM
DROP TABLE IF EXISTS `ORDER`; 
DROP TABLE IF EXISTS `CUSTOMER`;
DROP TABLE IF EXISTS `RESELLER`;
DROP TABLE IF EXISTS `PRODUCT`;



CREATE TABLE `PRODUCT` (
    `Type` VARCHAR(40),
	`Serial_No` INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`Manufacturing_Date` DATE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;

CREATE TABLE `RESELLER` (
    `Reseller_ID` INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`Company_Name` VARCHAR(40),
	`Adress` VARCHAR(40),
	`ZipCode` VARCHAR(40),
	`City` VARCHAR(40),
    `Country` VARCHAR(40),
	`Email` VARCHAR(40),
    `Telephone` VARCHAR(40),
    `Contact_Person` VARCHAR(40)
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;


CREATE TABLE `CUSTOMER` (
	`Customer_ID` INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`Customer_Surname` VARCHAR(40),
	`Customer_Firstname` VARCHAR(40),
	`Adress` VARCHAR(40),
	`ZipCode` VARCHAR(40),
	`City` VARCHAR(40),
    `Country` VARCHAR(40),
    `Email` VARCHAR(40),
    `Telephone` VARCHAR(40),
    `Day_Of_Birth` DATE,
    `RegistrationDate` DATE
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;


CREATE TABLE `ORDER` (
	`Order_ID` INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`Quantity` INT,
	`Price` VARCHAR(40),
	`OrderDate` DATE,
    `ShippingDate` DATE,
    `OrderStatus` VARCHAR(40),
    `Employee` VARCHAR(40),
    `Serial_No` INT,
   `Reseller_ID` INT,
   `Customer_ID` INT,
    CONSTRAINT `FK_SerialNo`
    FOREIGN KEY(`Serial_No`) REFERENCES `PRODUCT` (`Serial_No`),

    CONSTRAINT `FK_ReselID`
    FOREIGN KEY(`Reseller_ID`) REFERENCES `RESELLER` (`Reseller_ID`),
    
    CONSTRAINT `FK_CustID`
    FOREIGN KEY(`Customer_ID`) REFERENCES `CUSTOMER`(`Customer_ID`)
    ON UPDATE CASCADE
    ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=UTF8;


